// List Ëá™ÂÆö‰πâÂ¢ûÂà†ÊîπÊü•
import React, { useState } from "react";
import { Avatar, List, Skeleton, Button, Input, Modal, Form } from "antd";

const { Search } = Input;

const CUSTOMLIST = [
  {
    gender: "female",
    name: "Hennum",
    email: "munira.hennum@example.com",
    picture: "https://randomuser.me/api/portraits/women/19.jpg",
    nat: "NO",
  },
  {
    gender: "female",
    name: "Pulli",
    email: "nella.pulli@example.com",
    picture: "https://randomuser.me/api/portraits/women/22.jpg",
    nat: "FI",
  },
  {
    gender: "female",
    name: "Neva",
    email: "ellen.neva@example.com",
    picture: "https://randomuser.me/api/portraits/women/95.jpg",
    nat: "FI",
  },
];

const TodoList = () => {
  const [initLoading, setInitLoading] = useState(false); // loading Áä∂ÊÄÅ
  const [list, setList] = useState(CUSTOMLIST); // ÈªòËÆ§ list Êï∞ÊçÆ
  const [isModalOpen, setIsModalOpen] = useState(false); // Êñ∞Â¢ûÂºπÁ™óÁöÑÊòæÈöê

  const onFinish = (values) => {
    console.log("Success:", values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log("Failed:", errorInfo);
  };

  const handleOk = () => {
    setIsModalOpen(false);
  };

  const handleCancel = () => {
    setIsModalOpen(false);
  };

  const onSearch = (value) => {
    setInitLoading(true);
    let arr = [];
    list.forEach((item) => {
      if (item.nat === value) arr.push(item);
    });
    // ÊêúÁ¥¢ÁªìÊûú‰∏∫Á©∫Êó∂ÊêúÁ¥¢ÁªìÊûúÂ∫î‰∏∫ÂÖ®ÈÉ®Êï∞ÊçÆ
    if (value === "") {
      setList(CUSTOMLIST);
    } else {
      setList(arr);
    }
    // Âª∂Êó∂‰∏ÄÁßíÈíüÔºåÊ®°ÊãüÂä†ËΩΩÊïàÊûú
    setTimeout(() => {
      setInitLoading(false);
    }, 1000);
  };

  return (
    <div>
      <Search
        placeholder="ÊåâÁÖßÂõΩÂÆ∂Êù•ÊêúÁ¥¢"
        allowClear
        enterButton="ÊêúÁ¥¢"
        size="large"
        onSearch={onSearch}
      />
      <List
        loading={initLoading}
        itemLayout="horizontal"
        dataSource={list}
        renderItem={(item) => {
          // ÈÅçÂéÜ dataSource ÁöÑÊï∞ÊçÆÔºåËøîÂõûÈúÄË¶ÅÊ∏≤ÊüìÁöÑÊï∞
          return (
            <List.Item
              actions={[
                // eslint-disable-next-line jsx-a11y/anchor-is-valid
                <a key="list-loadmore-edit">ÁºñËæë</a>,
                // eslint-disable-next-line jsx-a11y/anchor-is-valid
                <a key="list-loadmore-more">Âà†Èô§</a>,
              ]}
            >
              <Skeleton avatar title={false} loading={initLoading} active>
                <List.Item.Meta
                  avatar={<Avatar src={item.picture} />}
                  title={<a href="#/other">{item.name}</a>}
                  description={
                    <>
                      <div>ÈÇÆÁÆ±üìÆÔºö{item.email}</div>
                      <div>ÂõΩÂÆ∂Ôºö{item.nat}</div>
                    </>
                  }
                />
              </Skeleton>
            </List.Item>
          );
        }}
      />
      {!initLoading ? (
        <div
          style={{
            textAlign: "center",
            marginTop: 12,
            height: 32,
            lineHeight: "32px",
          }}
        >
          <Button
            onClick={() => {
              setIsModalOpen(true);
            }}
          >
            Êñ∞Â¢ûÊï∞ÊçÆ
          </Button>
        </div>
      ) : null}
      <Modal
        title="Êñ∞Â¢ûÊï∞ÊçÆ"
        open={isModalOpen}
        onOk={handleOk}
        onCancel={handleCancel}
      >
        <Form
          name="basic"
          labelCol={{ span: 8 }}
          wrapperCol={{ span: 16 }}
          initialValues={{ remember: true }}
          onFinish={onFinish}
          onFinishFailed={onFinishFailed}
          autoComplete="off"
        >
          <Form.Item
            label="ÂêçÂ≠ó"
            name="name"
            rules={[{ required: true, message: "ËØ∑ËæìÂÖ•ÂêçÂ≠ó!" }]}
          >
            <Input />
          </Form.Item>

          <Form.Item
            label="ÈÇÆÁÆ±"
            name="email"
            rules={[{ required: true, message: "ËØ∑ËæìÂÖ•ÈÇÆÁÆ±üìÆ!" }]}
          >
            <Input />
          </Form.Item>

          <Form.Item
            label="Â§¥ÂÉè"
            name="picture"
            rules={[{ required: true, message: "ËØ∑Â°´ÂÜôÂ§¥ÂÉèÂõæÁâáÂú∞ÂùÄ!" }]}
          >
            <Input />
          </Form.Item>

          <Form.Item
            label="ÂõΩÂÆ∂"
            name="nat"
            rules={[{ required: true, message: "ËØ∑ËæìÂÖ•ÂõΩÂÆ∂!" }]}
          >
            <Input />
          </Form.Item>

          <Form.Item wrapperCol={{ offset: 8, span: 16 }}>
            <Button type="primary" htmlType="submit">
              Êèê‰∫§
            </Button>
          </Form.Item>
        </Form>
      </Modal>
    </div>
  );
};

export default TodoList;
